import React from 'react';
import styled from '@emtotion/styled';

const  ContenedorHeader = styled.header`

    background-color : #26C6DA;
    padding: 10px;
    font-weight: bold;
    color: #ffffff;
`;


const Header = ({titulo})=>{
    return(
        <header>
            <h1>{titulo}</h1>
        </header>
    );
}
export default Header;
